def make_mac_prefixes_db():
    filenmae = os.path.join(NMAP_DATA_PATH, "nmap-mac-prefixes")
    res = open(filenmae, "rb").read().decode("utf-8")
    
    data = dict()

    for line in res.splitlines():
        line = line.strip()
        
        if len(line) < 7:
            continue
        elif line.startswith("#"):
            continue
        else:
            mac_prefix = [ line[0:2], line[2:4], line[4:6] ]
            vendor = line[7:]
            key = line[0:6].upper()
            data[key] = vendor

    keys = list(map(lambda key: [ int(key[0:2], 16), int(key[2:4], 16), int(key[4:6], 16) ], data.keys()))
    keys.sort()

    def f(key):
        k = ", ".join(list(map(lambda n: "0x" + hex(n).replace("0x", "").rjust(2, "0"), key)))
        v = data[ "".join(list(map(lambda n: hex(n).replace("0x", "").rjust(2, "0"), key) )).upper() ]
        elem = """    MacVendor { prefix: [ %s ], vendor: "%s" }""" % ( k, v, )
        return elem
    
    code = """
pub static MAC_PREFIXES_DB: [MacVendor; %d] = [
%s
];

    """ % ( len(keys), ", \n".join(list(map(f, keys))) )

    return code


def make_service_open_frequency_db():
    filenmae = os.path.join(NMAP_DATA_PATH, "nmap-services")
    res = open(filenmae, "rb").read().decode("utf-8").replace("\t", " ").replace("\r\n", "\n")
    
    items = []

    # unknow_service_names = set()

    for line in res.splitlines():
        line = line.strip()
        # tcpmux    1/tcp   0.001995    # TCP Port Service Multiplexer [rfc-1078] | TCP Port Service Multiplexer
        if len(line) < 1:
            continue
        elif line.startswith("#"):
            continue
        else:
            tmp = line.split("#")[0].strip().split(" ")
            assert(len(tmp) == 3)

            tmp2 = tmp[1].split("/")
            item = {
                "name": tmp[0],
                "port": int(tmp2[0]),
                "protocol": tmp2[1].upper(),
                "open_frequency": float(tmp[2])
            }

            items.append(item)

    code = """
pub static SERVICE_OPEN_FREQUENCY_DB: [ServiceOpenFrequency; %TOTAL_LENGTH%] = [
"""
    total_items = 0
    for item in items:
        temp = "    ServiceOpenFrequency { service: Service { name_index: %d, protocol: %s, port: %d}, open_frequency: %f, }, \n"
        
        if item["name"] not in SERVICE_NAMES:
            # unknow_service_names.add(item["name"])
            print("[WARN] name `%s` not in SERVICE_NAMES!" % item["name"])
            continue

        if item["protocol"] != "TCP" and item["protocol"] != "UDP" and item["protocol"] != "SCTP":
            print("[WARN] unknow protocol: %s" % item["protocol"])
            continue

        name_index = SERVICE_NAMES.index(item["name"])
        protocol = None
        if item["protocol"] == "TCP":
            protocol = "Tcp"
        elif item["protocol"] == "UDP":
            protocol = "Udp"
        elif item["protocol"] == "SCTP":
            protocol = "Sctp"

        code += temp % ( name_index, protocol, item["port"], item["open_frequency"])
        total_items += 1

    code += "];\n\n"

    code = code.replace("%TOTAL_LENGTH%", str(total_items))

    return code




def make_services_db():
    filenmae = os.path.join(NMAP_DATA_PATH, "nmap-service-probes")
    res = open(filenmae, "rb").read().decode("utf-8").replace("\t", " ").replace("\r\n", "\n")
    
    service_names = set()
    data = dict()
    
    # https://nmap.org/book/vscan-fileformat.html
    lines = list(res.splitlines())
    idx = 0

    service_probes = {
        "exclude": None,
        "probes": [],
    }

    attrs = set()

    while idx < len(lines):
        line = lines[idx].strip()

        if len(line) < 10:
            idx += 1
        elif line.startswith("#"):
            idx += 1
        elif line.startswith("Exclude"):
            service_probes["exclude"] = line[7:].strip()
            idx += 1
        elif line.startswith("Probe") and ("TCP" in line or "UDP" in line):
            # Probe TCP GenericLines q|\r\n\r\n|
            tmp = line.split(" q|")
            header = tmp[0]
            
            probestring = None
            if len(tmp) > 1:
                probestring = "q|" + tmp[1]

            tmp = header.split(" ")
            protocol = tmp[1]
            probename = tmp[2]

            assert(protocol == "TCP" or protocol == "UDP")
            idx += 1
            probe = {
                "protocol": protocol,
                "probename": probename,
                "probestring": probestring,
                "attrs": {},
                "rules": [],
            }

            def is_attr_line(line):
                attr_names = ['fallback', 'ports', 'rarity', 'sslports', 'tcpwrappedms', 'totalwaitms']
                for attr_name in attr_names:
                    if line.startswith(attr_name):
                        return True

                return False

            stop_loop2 = False
            while stop_loop2 == False:
                line = lines[idx].strip()
                if len(line) < 1:
                    pass
                elif line.startswith("#"):
                    pass
                elif line.startswith("Probe"):
                    break
                elif is_attr_line(line):
                    # ['fallback', 'ports', 'rarity', 'sslports', 'tcpwrappedms', 'totalwaitms']
                    tmp = line.split(" ")
                    k = tmp[0].strip()
                    v = tmp[1].strip()
                    probe["attrs"][k] = v
                elif line.startswith("match") or line.startswith("softmatch"):
                    # match 3cx-tunnel m|^\x04\0\xfb\xffLAPK| p/3CX Tunnel Protocol/
                    tmp = line.split(" ")
                    if len(tmp) >= 3:
                        service_name = tmp[1].strip()
                        if service_name:
                            service_names.add(service_name)
                        
                        # match acap m|^\* ACAP \(IMPLEMENTATION \"CommuniGate Pro ACAP (\d[-.\w]+)\"\) | p/CommuniGate Pro ACAP server/ v/$1/ i/for mail client preference sharing/ 
                        text = " ".join(tmp[2:]).strip()
                        
                        result = get_pattern_and_versioninfo(text)
                        pattern = result[0]
                        versioninfo = result[1:]

                        if len(versioninfo) == 0:
                            versioninfo = None

                        
                        if pattern.startswith("m"):
                            rule = {
                                "is_soft_match": True if tmp[0] == "softmatch" else False,
                                "service_name": service_name,
                                "pattern": pattern,
                                "versioninfo": versioninfo,
                            }
                            probe["rules"].append(rule)
                        else:
                            print(result)
                else:
                    print("[WARN] Unknow Probe Attr: %s" % line)
                idx += 1

                if idx >= len(lines):
                    stop_loop2 = True

            service_probes["probes"].append(probe)
        else:
            print("[WARN] Unknow Probe Attr: %s" % line)
            idx += 1

    # CodeGen
    service_names = list(service_names)
    service_names.sort()

    #     code = """
    # pub static SERVICE_NAMES: [&'static str; %d] = [ %s ];
    # """ % ( len(service_names), ", ".join(list( map(lambda name: "\"%s\"" % name, service_names) )) )
    
    code = ""
    code += """pub static SERVICE_PROBES: [ServiceProbe; %d] = [\n""" % ( len(service_probes["probes"]), )

    for item in service_probes["probes"]:
        protocol = None
        if item["protocol"].upper() == "UDP":
            protocol = "Udp"
        elif item["protocol"].upper() == "TCP":
            protocol = "Tcp"
        else:
            raise ValueError("Ooops ...")

        tmp = """    ServiceProbe { protocol: %s, probename: "%s", probestring: &%s, """ % ( protocol, item["probename"], str(list(item["probestring"].encode("utf-8"))), )
        attrs = item["attrs"]
        attrs_keys = list(attrs.keys())
        for attr_key in ['fallback', 'ports', 'rarity', 'sslports', 'tcpwrappedms', 'totalwaitms']:
            if attr_key not in attrs_keys:
                tmp += "%s: None, " % attr_key
            else:
                if attr_key == "rarity":
                    v = int(attrs[attr_key])
                    assert(v > 0 and v < 10)
                    tmp += "rarity: Some(%d), " % v
                elif attr_key == "tcpwrappedms":
                    v = int(attrs[attr_key])
                    tmp += "tcpwrappedms: Some(%d), " % v
                elif attr_key == "totalwaitms":
                    v = int(attrs[attr_key])
                    tmp += "totalwaitms: Some(%d), " % v
                elif attr_key == "ports":
                    v = attrs[attr_key].split(",")
                    ports_code = "ports: Some(&["
                    for port in v:
                        if "-" not in port:
                            int(port)
                            ports_code += "Port::Number(%s), " % port
                        else:
                            port_range = port.split("-")
                            assert(len(port_range) == 2)
                            int(port_range[0])
                            int(port_range[1])
                            ports_code += "Port::Range((%s, %s)), " % (port_range[0], port_range[1])

                    ports_code += "]), "
                    tmp += ports_code
                elif attr_key == "sslports":
                    v = attrs[attr_key].split(",")
                    ports_code = "sslports: Some(&["
                    for port in v:
                        if "-" not in port:
                            int(port)
                            ports_code += "Port::Number(%s), " % port
                        else:
                            port_range = port.split("-")
                            assert(len(port_range) == 2)
                            int(port_range[0])
                            int(port_range[1])
                            ports_code += "Port::Range((%s, %s)), " % (port_range[0], port_range[1])

                    ports_code += "]), "
                    tmp += ports_code
                elif attr_key == "fallback":
                    v = attrs[attr_key]
                    tmp += "fallback: Some(\"%s\"), " % v

        tmp += "rules: &["
        for rule in item["rules"]:
            is_soft_match = str(rule["is_soft_match"]).lower()
            if rule["service_name"] not in SERVICE_NAMES:
                print(rule["service_name"])
                continue
            service_name_index = SERVICE_NAMES.index(rule["service_name"])
            versioninfo = ""
            if rule["versioninfo"] is not None:
                for x in rule["versioninfo"]:
                    versioninfo += """ &%s, """ % ( str(list(x.encode("utf-8"))), )
                pattern = str(list(rule["pattern"].encode("utf-8")))
            tmp += """\n        ServiceProbeMatchRule { is_soft_match: %s, service_name_index: %d, pattern: &%s, versioninfo: &[ %s ]}, \n""" % (is_soft_match, service_name_index, pattern, versioninfo)
        tmp += "    ],\n"

        tmp += "}, \n"
        code += tmp
    code += "];\n\n"

    return code

def get_pattern_and_versioninfo(s):
    if not s.startswith(" "):
        s = " " + s

    end_s = [" m", " p/", " v/", " i/", " h/", " o/", " d/", " cpe:/"]

    result = []

    idx = 0
    while idx < len(s):
        for es in end_s:
            if s[idx:].startswith(es):
                if idx > 0:
                    idx = idx
                    result.append(s[:idx].strip())
                    s = s[idx:]
                    idx = 0
        idx += 1
    
    if len(s) > 0:
        result.append(s.strip())

    return result

def make_service_names_db():
    service_names = list(set(SERVICE_NAMES))
    service_names.sort()

    code = """

pub static SERVICE_NAMES: [&'static str; %d] = [ %s ];

""" % ( len(service_names), ", ".join(list( map(lambda name: "\"%s\"" % name, service_names) )) )
    return code

